import "./NewExpense.css"
import ExpenseForm from "./ExpenseForm";

const NewExpense = () => {
    const omNewExpenseData = (data) => {
        const expenseData = {
            ...data,
            id : Math.random()
        }
    }

    return (
        <div className="new-expense">
            <ExpenseForm newExpenseData = {omNewExpenseData}/>
        </div>
    )
}

export default NewExpense;
